import React from 'react';
import './App.css';
import Header from './components/Header/Header.jsx';
import Navbar from './components/Navbar/Navbar.jsx';
import Profile from './components/Profile/Profile.jsx';
import Dialogs from './components/Dialogs/Dialogs.jsx';
import Music from './components/Music/Music.jsx';
import News from './components/News/News.jsx';
import Settings from './components/Settings/Settings.jsx';

import { BrowserRouter, Route } from 'react-router-dom';

const App = () => {
  return (
    <BrowserRouter>
      <div className='app-wrapper'>
        <Header />
        <Navbar />
        <div className='app-wrapper-content'>
          <Route path='/dialogs' component={Dialogs} activeClassNabe = {s.active}/>
          <Route path='/profile' component={Profile} activeClassNabe = {s.active}/>
          <Route path='/news' component={News} activeClassNabe = {s.active}/>
          <Route path='/music' component={Music} activeClassNabe = {s.active}/>
          <Route path='/settings' component={Settings} activeClassNabe = {s.active}/>
        </div>
      </div>
    </BrowserRouter>);
}

export default App;
